import DefaultLayout from '../components/DefaultLayout';
import { Button, Col, Container, Row, FormGroup, Label, CustomInput } from 'reactstrap';

export default function Report() {
    return (
        <DefaultLayout>
            <ReportIntroduction>
            </ReportIntroduction>
        </DefaultLayout>
    );
}

const ReportIntroduction = () => {
    var Winterfell = require('winterfell');
    let schema  = require('./schema');
    <Winterfell schema={schema} />,document.getElementById('form')
    return (
        <Container>
            <h1 className="display-3">Report a workplace concern</h1>
            <p className="lead">How it works:...</p>
            <div id="form">
                <Winterfell schema= {schema}></Winterfell>
            </div>
        </Container>
    );
}
